                        + '<div class="col8-5-12">'
                                + htmlArea
                                + htmlSubjects
                                + htmlSubsections
                            + '<div class="phone">' + currentPerson.phone + '</div>'
                        + '</div>'
                    + '</a>'
                    + '<div class="icons">'
                        + '<a class="mail icon-mail" href="' + currentPerson.encryptedMail + '"></a>'
                        + '<a class="phoneNumber icon-telefon" href="tel:' + currentPerson.phone + '"></a>'  
